DROP TABLE IF EXISTS instructor_info;

create table instructor_info (
	instructor_id VARCHAR(50) PRIMARY KEY,
	i_first_name VARCHAR(50) NOT NULL,
	i_last_name VARCHAR(50) NOT NULL,
	i_email VARCHAR(50) UNIQUE NOT NULL,
	i_gender VARCHAR(50) NOT NULL,
	i_experience INT NOT NULL,
	i_address VARCHAR(50) NOT NULL,
	i_country VARCHAR(50) NOT NULL,
	i_postalcode VARCHAR(50) NOT NULL
);
